ObjectStates.Description:
Simply click and drag a model and the distance in inches will be shown. Either use this method OR the Fallout ruler measuring method but not both in the same game as distance calculation is slightly different. To measure the distance between two models, hold down the Tab key and move your mouse pointer.
Ruler sizes (inches): Orange: 2; Yellow: 4; Red: 6;
Green: 8; Blue: 10; Black: 12.

